import React from 'react';

const ProfileCard = () => {
  const containerStyle = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    height: '100vh',
    backgroundColor: '#f0f0f0', // Optional: background color for the entire page
  };

  const cardStyle = {
    position: 'relative',
    width: '90%',
    maxWidth: '1000px', // Maximum width to keep the image from becoming too large
    textAlign: 'left',
    color: 'black',
  };

  const imageStyle = {
    width: '100%',
    height: 'auto',
    borderRadius: '10px',
  };

  const textBoxStyle = {
    position: 'absolute',
    top: '10%',
    left: '5%',
    backgroundColor: 'rgba(211, 211, 211, 0.8)', // Light grey with opacity
    padding: '20px',
    borderRadius: '5px',
  };

  const textStyle = {
    fontFamily: 'Arial, sans-serif',
    fontSize: '24px', // Increased font size
    fontWeight: 'bold',
  };

  return (
    <div style={containerStyle}>
      <div style={cardStyle}>
        <img 
          src="/path/to/image.png" 
          alt="Ethan Feiges" 
          style={imageStyle} 
        />
        <div style={textBoxStyle}>
          <div style={textStyle}>Ethan Feiges</div>
          <div style={textStyle}>College: UW-Madison</div>
          <div style={textStyle}>Major: CS</div>
          <div style={textStyle}>Year: Sophomore</div>
          <div style={textStyle}>Age: 19</div>
        </div>
      </div>
    </div>
  );
};

export default ProfileCard;
